{{Infobox dungeon |name = Mt. Coronet North |image = [[File:Mt. Coronet North.png|300px]] |caption = A map of Mt. Coronet North. |tokens = 69,500 |location = Southeast of Route 216, the absolute top of the 'mountain range' in the middle of the map. }} '''Mt. Coronet North''' is a [[Dungeons|dungeon]] in [[Sinnoh]]. It has 64 tiles arranged in an 8x8 square, including 8 chest tiles, 19 non-boss encounter tiles, and 1 boss encounter tile.
